import mongoose, { Schema, model } from "mongoose"

const UserScema = new Schema({
    name: {
        type: String
    }
})

UserScema.methods.toJSON = function () {
    var obj = this.toObject();
    delete obj.updated;
    return obj;
};

//Export user module
export default mongoose.models.User || model('User', UserScema);

